import React from 'react';
import ReactDOM from 'react-dom';

import './Modal.css';

export const Modal = (props: unknown) => {
	console.log(props)
	return (
		ReactDOM.createPortal(
			<section className="modal" data-theme="light">
				{props.children}
			</section>,
			document.body
		)
	)
}
